import React from 'react';
import './NavBar.scss';

const NavBar = () => (
  <div className="NavBar">
    <input type="text" />
    <button type="submit">Search</button>
    <button type="submit">
      Login/ Sign in
    </button>
  </div>
);

export default NavBar;
